(function(dust){dust.register("settings\/notifications\/eConsent",body_0);function body_0(chk,ctx){return chk.w("<p>Our records indicate that you have chosen to receive Disclosures and Billing Statements electronically instead of by paper.</p><p>Consent to Receive Billing Statements and Other Required Disclosures Electronically</p><p>Please review the following. When you are done, check the box below to verify your request to receive Billing Statements and Disclosures electronically instead of receiving them in paper form.</p><p>PayPal Credit E-Sign Consent</p><p>DEFINITIONS. In this PayPal Credit E-Sign Consent, the following definitions apply: \"You\" and \"your\" mean the person who is asking to use PayPal Credit to make a purchase or cash advance. \"We\", \"us\" and \"our\" mean the Lender and, following an assignment, any person, company, or bank to whom the rights of the Lender have been assigned. \"Disclosures\" mean important communications and other information relating to your application for and/or use of PayPal Credit, including but not limited to agreements, privacy notices, billing statements and changes in terms.</p><p>CONSUMER CONSENT. By clicking the \"Receive E-Statements\" button below, which you hereby adopt as your electronic signature, you consent and agree that:</p><ul><li><p>You are electing to stop receiving Disclosures in the mail.</p></li><li><p>We can provide Disclosures required by law and other information about your legal rights and duties to you electronically.</p></li><li><p>Your electronic signature on agreements and documents has the same effect as if you signed them in ink.</p></li><li><p>We can send all Disclosures to you electronically via our website or to the email address that you have provided to the merchant in this transaction or to another email address that you provide to us for that purpose rather than in paper form.</p></li><li><p>We may alert you when the Disclosures are available by sending you an electronic communication.</p></li><li><p>Our email will tell you how you can view the Disclosures.</p></li><li><p>We will make the Disclosures available to you for not less than 90 days from the date they first became available to you.</p></li><li><p>You will be able to print a copy of the Disclosures or download the information for your records.</p></li><li><p>This consent applies to all future Disclosures you receive, and to all future transactions in which you use PayPal Credit, at any time unless you have, prior to such transaction, withdrawn your consent by the procedure mentioned below.</p></li></ul><p>WHAT YOU WILL NEED. You understand that, in order to access and retain electronic Disclosures, you will need the following:<ul><li>A computer with an Internet connection.</li><li>A current web browser that includes 2048-bit encryption (e.g., Internet Explorer version 10.0 and above, Firefox version 27.0 and above, Chrome version 33.0 and above, or Safari version 7.0 and above) with cookies enabled.</li><li>A valid email address.</li><li>Sufficient storage space to save past Disclosures OR an installed printer to print them.</li><li>If you use a spam filter that blocks or re-routes emails from senders not listed in your email address book, you must add creditcustomersupport@paypal.com to your email address book.</li></ul></p><p>REQUESTING PAPER DOCUMENTS AND WITHDRAWING CONSENT. You understand that you may request paper copies of the Disclosures and that we will provide them to you by mail at no charge. You understand that you have the right to receive these Disclosures in paper form and that you may withdraw your consent by logging into www.paypal.com (if you have a PayPal account) where you can change your statement and disclosure preferences. You can also request paper copies and/or withdraw consent by contacting us at: PayPal Credit, P.O. Box 5138, Timonium, MD 21094 or 1-866-528-3733.</p><p>UPDATING EMAIL ADDRESS. At any time, you can update the email address to which we may send alerts that your Disclosures are available. You can change your email preferences by logging into www.paypal.com (if you have a PayPal account). You can also do this by contacting us at: PayPal Credit, P.O. Box 5138, Timonium, MD 21094 or 1-866-528-3733.</p><p>CONFIRMING THE CONSENT. You have examined the sample Billing Statement presented to you during this electronic Billing Statement enrollment and hereby confirm that you are able to view it and retain it for your records.</p><p>LEGAL EFFECT. By consenting, you agree that electronic Disclosures have the same meaning and effect as if we provided paper Disclosures to you when and if we are required to do so. When we send you a Disclosure in electronic form or post a Disclosure on our website, that shall have the same meaning and effect as if we provided paper Disclosures to you, whether or not you choose to view the Disclosures, unless you had previously withdrawn your consent to receive Disclosures electronically. We may also send you an email alerting you that the Disclosures are available electronically and make them available online.</p><p>GENERAL. You understand and agree that we reserve the right to cancel this electronic Disclosure service, change the terms of use of this service, or send Disclosures in paper form at any time. You understand and agree that we are not responsible for any delay or failure in your receipt of any email notices we may send.</p>");}body_0.__dustBody=!0;return body_0;})(dust);
